import React, { Component } from "react";

//import Searchbutton from "../components/Searchbutton";
import Nav from "../components/Nav";
import Header from "../components/Header";
import API from "../utils/API";
import Modal from "../components/Modal";
import Close from "../components/Close";
import Search from "../components/Search";
import Loginbox from "../components/LogInForms";
import ResultCards from "../components/ResultsCards";
import "./style.css";

function HorrorNav(props) {
    return (
      <Nav> 
        <button type="button" onClick={props.onShowLog} className="toLogIn">LOG IN</button>
        <a href="#">MY PROFILE</a>
        <button type="button" onClick={props.onSearch} className="toSearch">SEARCH</button>
      </Nav>
    )
  }
  
function ResultContainer(props) {
    return (
        <div className="results-here">
            <h2>Search Results for   "<span></span>"</h2>
            <ResultCards />
        
        </div>
    )
}

  
  
  
  
  class Results extends Component {
    state = {
      isOpen: false,
      isSignUp: false,
      isLog: false
    };
  
    
  
    handleOnSearch = (event) => {
      this.setState ({ isOpen: true })
    };
  
    handleOnClose = (event) => {
      this.setState ({ isOpen: false })
    };
    
    handleOnSign = (event) => {
      this.setState ({ isSignUp: true })
      
    };
  
    handleOnLogIn = (event) => {
      this.setState ({ isSignUp: false})
    };
  
    handleOnShowLog = (event) => {
      this.setState ({ isLog: true });
      
    };
  
    handleOnHideLog = (event) => {
      this.setState ({ isLog: false })
    }
  
    render() {
      return (
        <React.Fragment>
                <Header />
                <HorrorNav onSearch={this.handleOnSearch} onShowLog={this.handleOnShowLog} /> 
                <Modal isOpen={this.state.isOpen}>
                  <Close onClick={this.handleOnClose}/>
                  <Search />
                </Modal>
                <Loginbox handleOnLogIn={this.handleOnLogIn} handleOnHideLog={this.handleOnHideLog} handleOnSign={this.handleOnSign} isSignUp={this.state.isSignUp} isLog={this.state.isLog} />
                <ResultContainer />
                    
                
                
        </React.Fragment>
        
      );
    }
  }
  
  export default Results;
